const Home = () => {
    var i = 0;
    const handleClick = () => {
        console.log("Hello Ninjas");
    }
    const handleClickAgain = (i)=>{
        i = i+1
        return i
    }
    return (
        <div className="home">
            <h2>Homepage</h2>
            <button onClick={handleClick}>Click Me</button>
            <button onClick={() => { handleClickAgain(i)}}> Click Me Again</button>
            <p>{i}</p>
        </div>
    );
}

export default Home
